import React from "react";

const Todo = () => {
  return (
    <>
      <div style={{ textAlign: "center" }}>
        <h1>TODO List</h1>
        <input type="text" placeholder="Add items" />
        <button>+</button>
        <ul>
          <li>Apple</li>
          <li>Banana</li>
        </ul>
      </div>
    </>
  );
};

export default Todo;
